('node', 'page', 0, 53, 53, 'und', 0, '<p class="highlight-message"><strong>Drupal versions: </strong> Drupal 7.0, Drupal 6.0, Drupal 5.0<br> <strong>Author: </strong>www.drupal.org</p><p>A single web site could contain many types of content, such as informational pages, news items, polls, blog posts, real estate listings, etc. In Drupal, each item of content is called a node, and each node belongs to a single content type, which defines various default settings for nodes of that type, such as whether the node is published automatically and whether comments are permitted. (Note that in previous versions of Drupal, content types were known as node types.).</p><p>When you first install Drupal with the default installation profile, you will have two content types defined: "Article" and "Basic page" (called "Story" and "Page" in Drupal 5 and 6). When you enable other core and contributed modules (by visiting Modules), you will find that you have other content types available; you can also create your own content types (see below).</p><h3>Content types in Drupal 7 core</h3><h4>Article</h4><p>The Article content type is enabled in Drupal in the default installation profile. Articles are generally used for information that is updated more frequently and often cross-referenced and categorized (such as news items or resources). By default, Articles are sorted with the most recent post at the top, but this can be customized with contributed modules like Views."</p><h4>Basic page</h4><p>The Basic page content type is enabled in Drupal in the default installation profile. Typically Basic pages are used for static content that can (but are not required to) be linked into the main navigation bar.</p><h4>Blog Entry</h4><p>A Blog (short for weblog) is an online journal or diary, and the core Blog module allows registered users on your site to create their own blogs. Each entry in a user blog has content type Blog Entry.</p>', '', 'full_html'),
