(53, 'node', ' content type drupal versions  drupal 70 drupal 60 drupal 50 author  wwwdrupalorg a single web site could contain many types of content such as informational pages news items polls blog posts real estate listings etc in drupal each item of content is called a node and each node belongs to a single content type which defines various default settings for nodes of that type such as whether the node is published automatically and whether comments are permitted note that in previous versions of drupal content types were known as node types when you first install drupal with the default installation profile you will have two content types defined article and basic page called story and page in drupal 5 and 6 when you enable other core and contributed modules by visiting modules you will find that you have other content types available you can also create your own content types see below  content types in drupal 7 core article the article content type is enabled in drupal in the default installation profile articles are generally used for information that is updated more frequently and often crossreferenced and categorized such as news items or resources by default articles are sorted with the most recent post at the top but this can be customized with contributed modules like views  basic page the basic page content type is enabled in drupal in the default installation profile typically basic pages are used for static content that can but are not required to be linked into the main navigation bar blog entry a blog short for weblog is an online journal or diary and the core blog module allows registered users on your site to create their own blogs each entry in a user blog has content type blog entry  ', 0),
